/*
    gas_prices#dd gas_price:uint64 gas_limit:uint64 gas_credit:uint64
        block_gas_limit:uint64 freeze_due_limit:uint64 delete_due_limit:uint64
        = GasLimitsPrices;

    gas_prices_ext#de gas_price:uint64 gas_limit:uint64 special_gas_limit:uint64 gas_credit:uint64
        block_gas_limit:uint64 freeze_due_limit:uint64 delete_due_limit:uint64
        = GasLimitsPrices;
*/
export function parseGasPricesExt(slice: Slice | null | undefined) {
  if (!slice) {
    throw Error('Invalid config');
  }

  const magic = slice.loadUint(8);
  if (magic !== 0xDE) {
    throw Error('Invalid config');
  }

  const gasPrice = slice.loadUint(64);
  const gasLimit = slice.loadUint(64);
  const specialGasLimit = slice.loadUint(64);
  const gasCredit = slice.loadUint(64);
  const blockGasLimit = slice.loadUint(64);
  const freezeDueLimit = slice.loadUint(64);
  const deleteDueLimit = slice.loadUint(64);

  return {
    gasPrice,
    gasLimit,
    specialGasLimit,
    gasCredit,
    blockGasLimit,
    freezeDueLimit,
    deleteDueLimit,
  };
}

/*
  gas_flat_pfx#d1 flat_gas_limit:uint64 flat_gas_price:uint64 other:GasLimitsPrices
      = GasLimitsPrices;
*/
export function parseGasFlatPfx(slice: Slice | null | undefined) {
  if (!slice) {
    throw Error('Invalid config');
  }

  const magic = slice.loadUint(8);
  if (magic !== 0xD1) {
    throw Error('Invalid config');
  }

  const flatGasLimit = slice.loadUint(64);
  const flatGasPrice = slice.loadUint(64);
  // const other = slice.loadBuffer(Math.floor(slice.remainingBits / 8)).toString('hex');
  // const other = parseGasPricesExt(slice);
  const other = configParse20(slice);
  return {
    flatGasLimit,
    flatGasPrice,
    other,
  };
}

export function configParse20(slice: Slice | null | undefined): unknown {
  if (!slice) {
    throw Error('Invalid config');
  }

  const magic = slice.preloadUint(8);
  // if (!(magic === 0xDD || magic === 0xDE || magic === 0xD1)) {
  //     throw Error('Invalid config');
  // }
  if (magic === 0xDD) {
    throw Error('Not imlemented yet');
  } else if (magic === 0xDE) {
    return parseGasPricesExt(slice);
  } else if (magic === 0xD1) {
    return parseGasFlatPfx(slice);
  }

  throw Error('Invalid config');
}

/**
  param_limits#c3 underload:# soft_limit:# { underload <= soft_limit }
    hard_limit:# { soft_limit <= hard_limit } = ParamLimits;
*/
export function parseParamLimits(slice: Slice | null | undefined) {
  if (!slice) {
    throw Error('Invalid config');
  }

  const magic = slice.loadUint(8);
  if (magic !== 0xC3) {
    throw Error('Invalid config');
  }

  const underload = slice.loadUint(32);
  const soft_limit = slice.loadUint(32);
  const hard_limit = slice.loadUint(32);

  // return slice.loadBuffer(Math.floor(slice.remainingBits / 8)).toString('hex');
  // return slice.loadBuffer(3 * 32 / 8).toString('hex');
  return {
    underload,
    soft_limit,
    hard_limit,
  };
}

/**
  block_limits#5d bytes:ParamLimits gas:ParamLimits lt_delta:ParamLimits
    = BlockLimits;
*/
export function configParse22(slice: Slice | null | undefined): unknown {
  if (!slice) {
    throw Error('Invalid config');
  }

  const magic = slice.loadUint(8);
  if (magic !== 0x5D) {
    throw Error('Invalid config');
  }

  const bytes = parseParamLimits(slice);
  const gas = parseParamLimits(slice);
  const lt_delta = parseParamLimits(slice);

  return {
    bytes,
    gas,
    lt_delta,
  };
}



